module.exports = "<nav>\r\n  <ul>\r\n    <li class=\"home\"><a href=\"#\">Raymond D. Sarmiento</a></li>\r\n    <li><a href=\"#about-me\">About Me</a></li>\r\n    <li><a href=\"#skills\">Skills</a></li>\r\n    <li><a href=\"#hobbies\">Hobbies</a></li>\r\n    <li><a href=\"#contact\">Contact</a></li>\r\n  </ul>\r\n</nav>\r\n\r\n<header>\r\n  <div class=\"container\">\r\n    <img src=\"../assets/images/pp.png\" alt=\"Raymond Sarmiento\">\r\n  </div>\r\n  <h1>Raymond D. Sarmiento</h1>\r\n  <h2>Frontend Developer / Software Engineer</h2>\r\n</header>\r\n\r\n<main>\r\n  <!-- About Me -->\r\n  <section id=\"about-me\">\r\n    <h2 text-align-center>About Me</h2>\r\n    <div>\r\n      <p>I am mainly a Frontend Engineer that enjoys learning concepts and exploring ideas. I have over 5 years of experience in the software development industry that encompasses both frontend and backend coding. I am well experienced in team collaboration and have work on both small and large organizations.</p>\r\n\r\n      <p>I really enjoy solving problems and always game on challenges. Though I think of myself as a slow starter, that is because I do not move impulsively unless the task at hand makes sense, I have an overview of what needs to be done, all the variables are taken into consideration and the solution adheres the problem to be solved. I excel on situations where logic and analytical capabilities are required. If I took interest about an idea, a concept, a puzzle or a specific mechanism, I won't really stop until I understand how it works or how to solve it. I myself notice that sometimes I am becoming annoying since I do not stop asking questions until I am satisfied with the proposed answer.</p>\r\n    </div>\r\n  </section>\r\n  <!-- Skills -->\r\n  <section id=\"skills\">\r\n    <h2 text-align-center>Skills</h2>\r\n    <div class=\"card-deck\">\r\n      <div class=\"card-container\">\r\n        <div class=\"card\" #cardElement1\r\n          (mouseover)=\"onMouseOver(cardElement1)\"\r\n          (mouseout)=\"onMouseOut(cardElement1)\">\r\n          <div class=\"front\">\r\n            <div>Frontend</div>\r\n          </div>\r\n          <div class=\"back\">\r\n            <ul>\r\n              <li>AngularJS, Angular, RxJS</li>\r\n              <li>HTML5, CSS3</li>\r\n              <li>JavaScript, TypeScript</li>\r\n              <li>Webpack, Gulp, Grunt, Bower</li>\r\n              <li>Node, Npm, Yarn</li>\r\n              <li>Responsive Web Design</li>\r\n              <li>Unit Testing, Jasmine</li>\r\n              <li>PHP</li>\r\n            </ul>\r\n            <i (click)=\"lockElement(cardElement1)\" class=\"fa fa-unlock\"></i>\r\n          </div>\r\n        </div>\r\n      </div>\r\n      <div class=\"card-container\">\r\n        <div class=\"card\" #cardElement2\r\n          (mouseover)=\"onMouseOver(cardElement2)\"\r\n          (mouseout)=\"onMouseOut(cardElement2)\">\r\n            <div class=\"front\">\r\n              <div>Backend</div>\r\n            </div>\r\n            <div class=\"back\">\r\n              <ul>\r\n                <li>Java SE, Spring</li>\r\n                <li>C#, .Net Core</li>\r\n                <li>PHP</li>\r\n                <li>Sharepoint</li>\r\n                <li>MySQL, MSSQL</li>\r\n              </ul>\r\n              <i (click)=\"lockElement(cardElement2)\" class=\"fa fa-unlock\"></i>\r\n            </div>\r\n        </div>\r\n      </div>\r\n      <div class=\"card-container\">\r\n        <div class=\"card\" #cardElement3\r\n          (mouseover)=\"onMouseOver(cardElement3)\"\r\n          (mouseout)=\"onMouseOut(cardElement3)\">\r\n            <div class=\"front\">\r\n              <div>General Software Dev / DevOps</div>\r\n            </div>\r\n            <div class=\"back\">\r\n              <ul>\r\n                <li>Docker</li>\r\n                <li>Git, GitLab CI, Circle CI, CI/CD</li>\r\n                <li>Object Oriented Programming</li>\r\n                <li>MVC Architectural Pattern</li>\r\n                <li>Service-Oriented Architecture</li>\r\n              </ul>\r\n              <i (click)=\"lockElement(cardElement3)\" class=\"fa fa-unlock\"></i>\r\n            </div>\r\n        </div>\r\n      </div>\r\n      <div class=\"card-container\">\r\n        <div class=\"card\" #cardElement4\r\n          (mouseover)=\"onMouseOver(cardElement4)\"\r\n          (mouseout)=\"onMouseOut(cardElement4)\">\r\n            <div class=\"front\">\r\n              <div>Soft Skills</div>\r\n            </div>\r\n            <div class=\"back\">\r\n              <ul>\r\n                <li>Problem Solving Skill</li>\r\n                <li>Critical and Analytical Thinking</li>\r\n                <li>Team Player</li>\r\n                <li>Goal Driven</li>\r\n                <li>Good Communication Skill</li>\r\n                <li>Organizational Skill</li>\r\n              </ul>\r\n              <i (click)=\"lockElement(cardElement4)\" class=\"fa fa-unlock\"></i>\r\n            </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </section>\r\n  <!-- Hobbies -->\r\n  <section id=\"hobbies\">\r\n    <h2 text-align-center>Hobbies</h2>\r\n    <div class=\"hobby-container gunpla\">\r\n      <span>GunPla</span>\r\n      <p>I recently started this hobby of building cool plastic model kits, specifically Gundam models. It is very fulfulling when you started to see the kit being built up until the very last piece. I get to pose and brag these bad boys to other people too, though they might think that I'm a nerd who did not grew up and still plays plastic models up until this age.</p>\r\n    </div>\r\n    <div class=\"hobby-container computer-games\" text-align-right>\r\n      <span>Computer and Video Games</span>\r\n      <p>Don't know any developer who doesn't play computer or any sort of video games. Loved the nostalgic retro games like Mario, PacMan and Bomberman that always bring back the child me. I really enjoy diving into Real Time Strategy and Turn-based Games including Red Alert, Starcraft, Warcraft, Battle Realms and Fire Emblem. I spent lots of time playing Role Playing Games like Diablo II and Ragnarok. I've been a long time fan of Dota which I also played back in my college days.\r\n        <audio #audioPlayerPudge src=\"../assets/media/pudge_dismember.mp3\"></audio>\r\n        <i (click)=\"playAudio(audioPlayerPudge)\" class=\"fa fa-play\" cursor-pointer> Fresh Meat!</i>\r\n      </p>\r\n    </div>\r\n    <div class=\"hobby-container puzzles\">\r\n        <span>Puzzles and Riddles</span>\r\n        <p>I love solving logic puzzles and riddles. Let me share a simple one.</p>\r\n        <p>There are three boxes. One is labeled \"APPLES\" another is labeled \"ORANGES\". The last one is labeled \"APPLES AND ORANGES\". You know that each is labeled incorrectly.  You may ask me to pick one fruit from one box which you choose.<br><br> How can you label the boxes correctly?</p>\r\n      </div>\r\n    <div class=\"hobby-container movies\" text-align-right>\r\n      <span>Movies and Series</span>\r\n      <p>I am really into movies and series that have something to do with Heists, Prison Breaks, Crime or Slice of Life. I also like watching comedy and romance genre. Few of my favorites are Shawshank Redemption, Ocean's Eleven, Prison Break series, The Usual Suspect, Narcos series, The Town, Inside Man, 3 Idiots, The Pursuit of Happyness, Hello Stranger...</p>\r\n    </div>\r\n  </section>\r\n</main>\r\n\r\n<footer>\r\n  <div class=\"container\" id=\"contact\" text-align-center>\r\n    <h2 text-align-center>Contact Me</h2>\r\n    <div>Let's grab some good coffee and have a chat on ideas, or maybe exchange our own top 10 movies list. We can also build some GunPla while browsing memes and practicing sarcasm. Even become team mates and have a good old Dota game.\r\n    </div>\r\n    <br>\r\n    <div>\r\n      <h3>Drop me a message at</h3>\r\n      <ul>\r\n        <li>\r\n          <a href=\"mailto:raymonddsarmiento@gmail.com\">raymonddsarmiento@gmail.com</a> |\r\n          <a href=\"mailto:rsarmiento@peerlancers.com\">rsarmiento@peerlancers.com</a>\r\n        </li>\r\n        <li>\r\n          <a href=\"tel:+639176784675\">(+63) 917-578-4675</a>\r\n        </li>\r\n        <li>\r\n          <a href=\"https://www.linkedin.com/in/raymonddsarmiento/\" target=\"_blank\"><i class=\"fa fa-linkedin-square\"></i></a>\r\n          <a href=\"https://github.com/rsarmiento-pl\" target=\"_blank\"><i class=\"fa fa-github\"></i></a>\r\n        </li>\r\n      </ul>\r\n    </div>\r\n\r\n    <div>Copyright &copy; 2019 | <a href=\"#\">Raymond D. Sarmiento</a> </div>\r\n  </div>\r\n</footer>\r\n"

